                'content'   => '<p>La legisladora porteña&nbsp;Ofelia Fernández calificó de “basura humana”&nbsp;a la diputada nacional y candidata a vicepresidente&nbsp;Victoria Villarruel por haber definido a <strong><em>Estela de Carlotto como un “personaje siniestro”</em></strong>. También afirmó que el acto realizado ayer para reivindicar a las “víctimas del terrorismo” fue una&nbsp;“provocación”.</p><p>Sobre el acto <em>negacionista </em>que protagonizó <u>Villarruel </u>en la <strong><em><u>Legislatura porteña</u></em></strong>, Fernández dijo que&nbsp;“no le preocupa”&nbsp;y, entrevistada en&nbsp;<em>América,</em>&nbsp;profundizó: “Yo soy de una generación que creció en democracia,&nbsp;para mí hablar así de Estela de Carlotto es de basura humana&nbsp;porque estoy convencida de que Madres y Abuelas de Plaza de Mayo&nbsp;son las que garantizaron que Argentina sea distinta al resto de los países latinoamericanos”.</p><p><br></p><p>Sobre esta diferencia en cuanto al tratamiento de la Memoria, la Verdad y la Justicia, la diputada recordó que Argentina fue un país que vio “a los militares ir a juicio, ¡nosotros vimos a Videla morir en la cárcel! Crecimos aprendiendo esto en la escuela y estoy convencida de que vamos a ser la barrera para que&nbsp;defensores del terrorismo de Estado, como esta mujer, no lleguen a la Casa Rosada”.</p><p><br></p><p>Asimismo, sobre el acto al que <strong>Estela de Carlotto pidió no darle importancia</strong>, Ofelia analizó: “Reconocer esas víctimas hubiese demandado en su momento que se lleven a juicio&nbsp;o se analicen prudentemente. Lamentablemente, hubo un golpe de Estado en Argentina y lo único que pasó es que los militares tomaron al Estado para desaparecer, torturar y secuestrar a los hijos de esa generación de militantes”.</p><p>“El problema de discursos como este es que&nbsp;piensan que es todo lo mismo, cuando son los propios militares los que impidieron saber con exactitud qué pasó antes. Son los que&nbsp;boicotearon el propio sentido de Justicia sobre el que ahora se montan para provocar&nbsp;desde este lugar”, sostuvo la diputada del Frente de Todos.</p><p><br></p><p>Entrevistada en el programa&nbsp;<em>Desayuno Americano</em>, conducido por&nbsp;<em>Pamela David</em>, que se emite por&nbsp;<em>América</em>, Fernández opinó que el intento de provocación de La Libertad Avanza “les va a salir mal, porque yo confío mucho en la memoria del pueblo argentino y en su relación con esa parte de la historia”.</p><p>Victoria Villarruel, sobre Estela de Carlotto: “Con ese cariz de abuelita buena, justificó el terrorismo”</p><p>“Creo que&nbsp;se va a terminar pasando de rosca, porque una cosa es el homenaje a las víctimas y otra es comparar a esas víctimas con el terrorismo de Estado planificado, que desapareció a una generación entera, torturándola en centros clandestinos en los que todavía no sabemos bien lo que pasó”, remarcó.</p><p>Al ser consultada sobre la posibilidad de que este acto fuera un “guiño represivo para lo que puede venir, en términos de decisiones económicas, en el proyecto de Javier Milei”, Ofelia Fernández respondió: “Evidentemente. Hacen planteos presupuestarios en relación a las fuerzas militares y lo que piensan que tiene que tener Defensa.&nbsp;Tienen un rol pensado para las Fuerzas Armadas en su gobierno que, por la historia argentina, puede ser un poco preocupante”.</p><p><br></p><h2><strong>La relación de Abuelas y Madres de Plaza de Mayo con el kirchnerismo</strong></h2><p><br></p><p>En la misma entrevista, a la diputada porteña le consultaron si creía que el acto negacionista en la Legislatura fue posible como “consecuencia de la alineación kirchnerista de Abuelas y Madres de Plaza de Mayo”, a lo que Ofelia Fernández opinó que “eso es problema de la&nbsp;gente que no puede separar la lucha por los Derechos Humanos de las Abuelas de sus posiciones políticas&nbsp;que, además, no son arbitrarias”.</p><p><br></p><p>Sobre esa relación, dijo que es “el único gobierno que no le puso peros a la defensa de los <strong>Derechos Humanos</strong> y a la reivindicación de la Memoria, la Verdad y la Justicia. En relación a la última dictadura militar,&nbsp;fueron los gobiernos de Néstor y Cristina”. Por ello, recordó que “con Alfonsín pensamos en la&nbsp;obediencia debida&nbsp;y el&nbsp;punto final, tenés a Menem y los&nbsp;indultos, hubo partes y fue complejo, pero el único que bajó los cuadros…”, sugirió.</p><p><br></p><p><br></p>',
